(13470, 2782, 0, 1, '妳和我', '', '0000-00-00 00:00:00', 0000, 15, 0, 7, '妳和我 詞: mei  曲:阿Joe 2007/ 9/10\r\n還有多久 要分離\r\n一貫作風的妳還是微笑的臉\r\n回想過去在學校嘻鬧日子裡\r\n好在我們有很珍惜 \r\n\r\n如果有那一天突然相遇\r\n我們會不會像現在一樣的呢?!\r\n\r\n妳和我 要各自試著去闖\r\n不再依賴對方\r\n若累了 要放聲大叫吧\r\n\r\n回想去年我們還一起跨年\r\n當時的我剛剛失戀\r\n此時此刻不願的一句再見\r\n不爭氣的淚流下來\r\n\r\n許下我們的承諾 不會變\r\n未來的日子\r\n要更堅強一些些 一些些\r\n\r\n妳和我 要各自試著去闖\r\n不再依賴對方\r\n若累了 就放聲大哭吧~Ah~yayaya~~Ah\r\n\r\n從今後 我們學會長大\r\n寂寞不再害怕~\r\n若想哭  就放聲大哭吧~Ah~yayaya~~Ah\r\n妳和我 都學會怎麼長大\r\n寂寞不再害怕\r\n若想哭 就到我懷裡吧~Ah~yayaya~~Ah\r\n\r\n妳和我 都一樣 回想著那時可愛的模樣 也悄悄睡著了 \r\n\r\n', '', 262, '', '阿joe', 'mei', '阿joe', '紐約客', '', 0, 0, 1, '2009-01-20 10:21:49', '2013-10-07 17:14:04', '0000-00-00 00:00:00'),
(13471, 2782, 1247, 3, '房間', '', '2009-01-11 00:00:00', 0000, 15, 0, 7, '    房間  曲:Randy&阿Joe 詞:mei 2007/10/21\r\n\r\n我的房間什麼都有\r\n心情好壞都在裡頭\r\n還養隻小狗 他叫作Jugar會天天陪著我  \r\n\r\n今天心情實在不好\r\n好想逃避 誰來救我\r\n回到房間左思右想  我終於想通\r\n\r\n我拿起吉他 刷呀刷呀\r\n隨心所欲唱唱  隨心所欲跳跳\r\n理想主義者 事事都重要\r\n看清事實也好 沒有虛偽最好\r\n我自由自在的飛 \r\n飛向慾望  飛躍理想 的 主張\r\n\r\n假日的我只有自己坐在房間回想過去\r\n打開相本全都是你 最美的記憶\r\n\r\n開著車子到處走走  \r\n每個地方都是回憶\r\n怎麼不想你的聲音 快回到我身邊\r\n\r\nJugar又睡著了 還傻呼呼的 \r\n就這樣過了一天\r\n\r\n我拿起吉他 刷呀刷呀\r\n隨心所欲唱唱  隨心所欲跳跳\r\n理想主義者 事事都重要\r\n看清事實也好 沒有虛偽最好\r\n我自由自在的飛 \r\n飛向慾望  飛躍理想 的 主張', '', 186, '', '阿joe', 'mei', '紐約客', '紐約客', '', 0, 1, 0, '2009-01-20 10:25:51', '2015-03-12 13:37:22', '0000-00-00 00:00:00'),
